import React from 'react'

function VideoList(props) {
    return (
        <ul>
        {props.videos
          .filter((video) => video.id !== props.currentVideo)
          .map((video) => (
            <li key={video.id}>
              <h3>{video.title}</h3>
              <img src={video.image} alt="" />
            </li>
          ))}
      </ul>
    )
}

export default VideoList
